import { Button } from '@mui/material';
import React from 'react'
import ReactPlayer from 'react-player';
import { useState } from 'react';
import Videos from './Videos';
function Feed() {
    const videos=["http://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ElephantsDream.mp4","https://player.vimeo.com/external/372335193.sd.mp4?s=80151fa22b2eba81883c8641f2c9e493762c7357&profile_id=164&oauth2_token_id=57447761"]
    return (
        <div className='flex flex-col w-full h-full justify-center items-center mt-10'>
            <div>
                <Button variant='outlined'>Upload Video</Button>
            </div>
            <div className='flex flex-col justify-center items-center'>
                {videos.map(video => {
                    return <Videos videoLink = {video}></Videos>
                })}
            </div>
        </div>
    )
}

export default Feed
